import React from 'react';
import { BrowserRouter as Router, Route, Switch, useHistory } from 'react-router-dom';

// Import all page components here
import EvidencijaLovaca from './pages/PopisLovaca';
import RasporedAktivnosti from './pages/RasporedAktivnosti';
import EvidencijaPrisutnosti from './pages/PopisOstrjela';
// ... import other components as needed

function App() {


  return (
    <div className="app">
      <button onClick={() => openPage('/evidencija-lovaca')}>EVIDENCIJA LOVACA</button>
      <button onClick={() => openPage('/raspored-aktivnosti')}>RASPORED AKTIVNOSTI I LOVA</button>
      <button onClick={() => openPage('/evidencija-prisutnosti')}>EVIDENCIJA PRISUTNOSTI NA LOVNI DAN</button>
      {/* ... more buttons for other pages */}
    </div>
  );
}

function Routing() {
  return (
    <Router>
      <Switch>
        <Route path="/evidencija-lovaca" component={EvidencijaLovaca} />
        <Route path="/raspored-aktivnosti" component={RasporedAktivnosti} />
        <Route path="/evidencija-prisutnosti" component={EvidencijaPrisutnosti} />
        {/* ... more routes for other pages */}
      </Switch>
    </Router>
  );
}

export default Routing;
